import React from 'react';
import profileIcon from "./profile-icon.jpg";

export const Portfolio = () => {
	return (
    	<div className="header">
			<img src={profileIcon} className="profile-icon" alt="Whoops..." />
			Hello World!
		</div>
	);
}
